import React from 'react';
import {Redirect} from 'react-router-dom';

export const AcademyAppConfig = {
    settings: {
        layout: {}
    },
    routes  : [

        {
            path     : '/academy',
            component: React.lazy(() => import('./crp/tabs'))
        } 



    ]
};
